import React, { useEffect, useState } from "react";

function Content({ response }) {
  const formatContent = (content) => {
    content.json().then((data) => {
      console.log(data);
      if (data["mythic_plus_weekly_highest_level_runs" != 0]) {
        return (
          "Your highest mythic keystone is " +
          data["mythic_plus_weekly_highest_level_runs"][0]
        );
      } else {
        return "This character has not completed a mythic keystone for this week!";
      }
    });
  };

  var content = "";

  response
    ? response.ok
      ? (content = formatContent(response))
      : (content = "could not find character")
    : (content = "there will be content here!!");

  return <div>{content}</div>;
}

export default Content;
